import React, { Component } from 'react';
import css from './header.module.css';

export default class InputReadOnly extends Component {
  render() {
    const {
      baseINSS,
      discountINSS,
      baseIRPF,
      discountIRPF,
      netSalary,
    } = this.props;

    return (
      <div className="row">
        <div className="col s2">
          <span>Base INSS:</span>
          <input
            className={css.button}
            type="text"
            value={baseINSS}
            readOnly
          ></input>
        </div>
        <div>
          <span>Desconto INSS:</span>
          <input
            className={`${css.button} ${css.button}`}
            type="text"
            value={discountINSS}
            readOnly
          ></input>
        </div>
        <div>
          <span>Base IRPF:</span>
          <input
            className={css.button}
            type="text"
            value={baseIRPF}
            readOnly
          ></input>
        </div>
        <div>
          <span>Desconto IRPF:</span>
          <input
            className={`${css.colorRed} ${css.button}`}
            type="text"
            value={discountIRPF}
            readOnly
          ></input>
        </div>
        <div>
          <span>Salário Líquido:</span>
          <input
            className={`${css.colorGreen} ${css.button}`}
            type="text"
            value={netSalary}
            readOnly
          ></input>
        </div>
      </div>
    );
  }
}
